INSERT INTO `pms_sectors` VALUES ('1000','Education','Education','Admin','2016-12-26 23:51:25','H','\r'),('110','EDUCATION','Education','Admin','2016-12-26 23:51:25','D','\r'),('111','Education, level unspecified','The codes in this category are to be used only when level of education is unspecified or unknown (e.g. training of primary school teachers should be coded under 11220).\r','Admin','2016-12-26 23:51:25','D','110\r'),('11110','Education policy and administrative management','Education sector policy, planning and programmes, aid to education ministries, administration and management systems, institution capacity building and advice, school management and governance, curriculum and materials development, unspecified education activities.\r','Admin','2016-12-26 23:51:25','D','111\r'),('11120','Education facilities and training','Educational buildings, equipment, materials, subsidiary services to education (boarding facilities, staff housing), language training, colloquia, seminars, lectures, etc.\r','Admin','2016-12-26 23:51:25','D','111\r'),('11130','Teacher training','Teacher education (where the level of education is unspecified), in-service and pre-service training, materials development.\r','Admin','2016-12-26 23:51:25','D','111\r'),('11182','Educational research','Research and studies on education effectiveness, relevance and quality, systematic evaluation and monitoring.\r','Admin','2016-12-26 23:51:25','D','111\r'),('112','Basic education','\r','Admin','2016-12-26 23:51:25','D','110\r'),('11220','Primary education','Formal and non-formal primary education for children, all elementary and first cycle systematic instruction, provision of learning materials.\r','Admin','2016-12-26 23:51:25','D','112\r'),('11230','Basic life skills for youth and adults','Formal and non-formal education for basic life skills for young people and adults (adults education), literacy and numeracy training.\r','Admin','2016-12-26 23:51:25','D','112\r'),('11231','Basic life skills for youth','Formal and non-formal education for basic life skills for young people.\r','Admin','2016-12-26 23:51:25','D','11230\r'),('11232','Primary education equivalent for adults','Formal primary education for adults.\r','Admin','2016-12-26 23:51:25','D','11230\r'),('11240','Early childhood education','Formal and non-formal pre-school education.\r','Admin','2016-12-26 23:51:25','D','112\r'),('113','Secondary education','\r','Admin','2016-12-26 23:51:25','D','110\r'),('11320','Secondary education','Second cycle systematic instruction at both junior and senior levels.\r','Admin','2016-12-26 23:51:25','D','113\r'),('11321','Lower secondary education','Second cycle systematic instruction at junior level.\r','Admin','2016-12-26 23:51:25','D','11320\r'),('11322','Upper secondary education','Second cycle systematic instruction at senior level.\r','Admin','2016-12-26 23:51:25','D','11320\r'),('11330','Vocational training','Elementary vocational training and secondary level technical education, on-the job training, apprenticeships, including informal vocational training.\r','Admin','2016-12-26 23:51:25','D','113\r'),('114','Post-secondary education','\r','Admin','2016-12-26 23:51:25','D','110\r'),('11420','Higher education','Degree and diploma programmes at universities, colleges and polytechnics, scholarships.\r','Admin','2016-12-26 23:51:25','D','114\r'),('11430','Advanced technical and managerial training','Professional-level vocational training programmes and in-service training.\r','Admin','2016-12-26 23:51:25','D','114\r'),('120','HEALTH','\r','Admin','2016-12-26 23:51:25','D','\r'),('121','Health, general','\r','Admin','2016-12-26 23:51:25','D','120\r'),('12110','Health policy and administrative management','Health sector policy, planning and programmes, aid to health ministries, public health administration, institution capacity building and advice, medical insurance programmes, unspecified health activities.\r','Admin','2016-12-26 23:51:25','D','121\r'),('12181','Medical education/training','Medical education and training for tertiary level services.\r','Admin','2016-12-26 23:51:25','D','121\r'),('12182','Medical research','General medical research (excluding basic health research).\r','Admin','2016-12-26 23:51:25','D','121\r'),('12191','Medical services','Laboratories, specialised clinics and hospitals (including equipment and supplies), ambulances, dental services, mental health care, medical rehabilitation, control of non-infectious diseases, drug and substance abuse control [excluding narcotics traffic control (16063)].\r','Admin','2016-12-26 23:51:25','D','121\r'),('122','Basic health','\r','Admin','2016-12-26 23:51:25','D','120\r'),('12220','Basic health care','Basic and primary health care programmes, paramedical and nursing care programmes, supply of drugs, medicines and vaccines related to basic health care.\r','Admin','2016-12-26 23:51:25','D','122\r'),('12230','Basic health infrastructure','District-level hospitals, clinics and dispensaries and related medical equipment, excluding specialised hospitals and clinics (12191).\r','Admin','2016-12-26 23:51:25','D','122\r'),('12240','Basic nutrition','Direct feeding programmes (maternal feeding, breastfeeding and weaning foods, child feeding, school feeding), determination of micro-nutrient deficiencies, provision of vitamin A, iodine, iron etc., monitoring of nutritional status, nutrition and food hygiene education, household food security.\r','Admin','2016-12-26 23:51:25','D','122\r'),('12250','Infectious disease control','Immunisation, prevention and control of infectious and parasite diseases, except malaria (12262), tuberculosis (12263), HIV/AIDS and other STDs (13040). It includes diarrheal diseases, vector-borne diseases (e.g. river blindness and guinea worm), viral diseases, mycosis, helminthiasis, zoonosis, diseases by other bacteria and viruses, pediculosis, etc.\r','Admin','2016-12-26 23:51:25','D','122\r'),('12261','Health education','Information, education and training of the population for improving health knowledge and practices, public health and awareness campaigns, promotion of improved personal hygiene practices, including use of sanitation facilities and handwashing with soap.\r','Admin','2016-12-26 23:51:25','D','122\r'),('12262','Malaria control','Prevention and control of malaria.\r','Admin','2016-12-26 23:51:25','D','122\r'),('12263','Tuberculosis control','Immunisation, prevention and control of tuberculosis.\r','Admin','2016-12-26 23:51:25','D','122\r'),('12281','Health personnel development','Training of health staff for basic health care services.\r','Admin','2016-12-26 23:51:25','D','122\r'),('130','POPULATION POLICIES/ PROGRAMMES AND REPRODUCTIVE HEALTH','\r','Admin','2016-12-26 23:51:25','D','\r'),('13010','Population policy and administrative management','Population/development policies, census work, vital registration, migration data, demographic research/analysis, reproductive health research, unspecified population activities.\r','Admin','2016-12-26 23:51:25','D','130\r'),('13020','Reproductive health care','Promotion of reproductive health, prenatal and postnatal care including delivery, prevention and treatment of infertility, prevention and management of consequences of abortion, safe motherhood activities.\r','Admin','2016-12-26 23:51:25','D','130\r'),('13030','Family planning','Family planning services including counselling, information, education and communication (IEC) activities, delivery of contraceptives, capacity building and training.\r','Admin','2016-12-26 23:51:25','D','130\r'),('13040','STD control including HIV/AIDS','All activities related to sexually transmitted diseases and HIV/AIDS control e.g. information, education and communication, testing, prevention, treatment, care.\r','Admin','2016-12-26 23:51:25','D','130\r'),('13081','Personnel development for population and reproductive health','Education and training of health staff for population and reproductive health care services.\r','Admin','2016-12-26 23:51:25','D','\r'),('140','WATER AND SANITATION','\r','Admin','2016-12-26 23:51:25','D','\r'),('14010','Water sector policy and administrative management','Water sector policy and governance, including legislation, regulation, planning and management as well as transboundary management of water, institutional capacity development, activities supporting the Integrated Water Resource Management approach (IWRM: see box below).\r','Admin','2016-12-26 23:51:25','D','140\r'),('14015','Water resources conservation (including data collection)','Collection and usage of quantitative and qualitative data on water resources, creation and sharing of water knowledge, conservation and rehabilitation of inland surface waters (rivers, lakes etc.), ground water and coastal waters, prevention of water contamination.\r','Admin','2016-12-26 23:51:25','D','140\r'),('14020','Water supply and sanitation - large systems','Programmes where components according to 14021 and 14022 cannot be identified. When components are known, they should individually be reported under their respective purpose codes: water supply (14021), sanitation (14022), and hygiene (12261).\r','Admin','2016-12-26 23:51:25','D','140\r'),('14021','Water supply - large systems','Potable water treatment plants, intake works, storage, water supply pumping stations, large scale transmission / conveyance and distribution systems.\r','Admin','2016-12-26 23:51:25','D','140\r'),('14022','Sanitation - large systems','Large scale sewerage including trunk sewers and sewage pumping stations, domestic and industrial waste water treatment plants.\r','Admin','2016-12-26 23:51:25','D','140\r'),('14030','Basic drinking water supply and basic sanitation','Programmes where components according to 14031 and 14032 cannot be identified. When components are known, they should individually be reported under their respective purpose codes: water supply (14031), sanitation (14032), and hygiene (12261).\r','Admin','2016-12-26 23:51:25','D','140\r'),('14031','Basic drinking water supply','Rural water supply schemes using handpumps, spring catchments, gravity-fed systems, rainwater collection and fog harvesting, storage tanks, small distribution systems typically with shared connections/points of use. Urban schemes using handpumps and local neighbourhood networks including those with shared connections.\r','Admin','2016-12-26 23:51:25','D','140\r'),('14032','Basic sanitation','Latrines, on-site disposal and alternative sanitation systems, including the promotion of household and community investments in the construction of these facilities. (Use code 12261 for activities promoting improved personal hygiene practices.)\r','Admin','2016-12-26 23:51:25','D','140\r'),('14040','River basins development','Infrastructure-focused integrated river basin projects and related institutional activities, river flow control, dams and reservoirs [excluding dams primarily for irrigation (31140) and hydropower (23065) and activities related to river transport (21040)].\r','Admin','2016-12-26 23:51:25','D','140\r'),('14050','Waste management / disposal','Municipal and industrial solid waste management, including hazardous and toxic waste, collection, disposal and treatment, landfill areas, composting and reuse.\r','Admin','2016-12-26 23:51:25','D','140\r'),('14081','Education and training in water supply and sanitation','Education and training for sector professionals and service providers.\r','Admin','2016-12-26 23:51:25','D','140\r'),('150','GOVERNMENT AND CIVIL SOCIETY','Includes assistance to strengthen the administrative apparatus and government.\r','Admin','2016-12-26 23:51:25','D','\r'),('151','Government and civil society, general','N.B. Use code 51010 for general budget support.\r','Admin','2016-12-26 23:51:25','D','150\r'),('15110','Public sector policy and administrative management','Institution-building assistance to strengthen core public sector management systems and capacities. This includes macro-economic and other policy management, co-ordination, planning and reform, human resource management, organisational development, civil service reform, e-government, development planning, monitoring and evaluation, support to ministries involved in aid co-ordination, other ministries and government departments when sector cannot be specified. (Use specific sector codes for development of systems and capacities in sector ministries.)\r','Admin','2016-12-26 23:51:25','D','151\r'),('15111','Public Finance Management (PFM)','Fiscal policy and planning, support to ministries of finance, strengthening financial and managerial accountability, public expenditure management, improving financial management systems, budget drafting, inter-governmental fiscal relations, public audit, public debt. (Use code 15114 for domestic revenue mobilisation and code 33120 for customs).\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15112','Decentralisation and support to subnational government','Decentralisation processes (including political, administrative and fiscal dimensions), intergovernmental relations and federalism, strengthening departments of regional and local government, regional and local authorities and their national associations. (Use specific sector codes for decentralisation of sector management and services.)\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15113','Anti-corruption organisations and institutions','Specialised organisations, institutions and frameworks for the prevention of and combat against corruption, bribery, money- laundering and other aspects of organised crime, with or without law enforcement powers, e.g. anti-corruption commissions and monitoring bodies, special investigation services, institutions and initiatives of integrity and ethics oversight, specialised NGOs, other civil society and citizens organisations directly concerned with corruption.\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15114','Domestic Revenue Mobilisation','Support to domestic revenue mobilisation/tax policy, analysis and administration as well as non-tax public revenue, which includes work with ministries of finance, line ministries, revenue authorities or other local, regional or national public bodies. (Use code 16010 for social security and other social protection.)\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15116','Tax collection','Operation of the inland revenue authority.\r','Admin','2016-12-26 23:51:25','D','15114\r'),('15117','Budget planning','Operation of the budget office and planning as part of the budget process.\r','Admin','2016-12-26 23:51:25','D','15111\r'),('15118','National audit','Operation of the accounting and audit services.\r','Admin','2016-12-26 23:51:25','D','15111\r'),('15119','Debt and aid management','Management of public debt and foreign aid received (in the partner country). For reporting on debt reorganisation, use codes 600xx.\r','Admin','2016-12-26 23:51:25','D','15111\r'),('15121','Foreign affairs','Administration of external affairs and services.\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15122','Diplomatic missions','Operation of diplomatic and consular missions stationed abroad or at offices of international organisations.\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15123','Administration of developing countries\' foreign aid','Support to administration of developing countries\' foreign aid (including triangular and south-south cooperation).\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15124','General personnel services','Administration and operation of the civil service including policies, procedures and regulations.\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15125','Central procurement','Administration and operation of centralised supply and purchasing services.\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15126','Other general public services','Maintenance and storage of government records and archives, operation of government-owned or occupied buildings, central motor vehicle pools, government-operated printing offices, centralised computer and data processing services, etc.\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15127','National monitoring and evaluation','Operation or support of institutions providing national monitoring and evaluation.\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15128','Local government finance','Financial transfers to local government, support to institutions managing such transfers. (Use specific sector codes for sector-related transfers.)\r','Admin','2016-12-26 23:51:25','D','15112\r'),('15129','Other central transfers to institutions','Transfers to non sector-specific autonomous bodies or state-owned enterprises outside of local government finance, support to institutions managing such transfers. (Use specific sector codes for sector-related transfers.)\r','Admin','2016-12-26 23:51:25','D','15112\r'),('15130','Legal and judicial development','Support to institutions, systems and procedures of the justice sector, both formal and informal, support to ministries of justice, the interior and home affairs, judges and courts, legal drafting services, bar and lawyers associations, professional legal education, maintenance of law and order and public safety, border management, law enforcement agencies, police, prisons and their supervision, ombudsmen, alternative dispute resolution, arbitration and mediation, legal aid and counsel, traditional, indigenous and paralegal practices that fall outside the formal legal system. Measures that support the improvement of legal frameworks, constitutions, laws and regulations, legislative and constitutional drafting and review, legal reform, integration of formal and informal systems of law. Public legal education, dissemination of information on entitlements and remedies for injustice, awareness campaigns. (Use codes 152xx for activities that are primarily aimed at supporting security system reform or undertaken in connection with post-conflict and peace building activities.)\r','Admin','2016-12-26 23:51:25','D','151\r'),('15131','Justice, law and order policy, planning and administration','Judicial law and order sectors, policy development within ministries of justice or equivalents.\r','Admin','2016-12-26 23:51:25','D','15130\r'),('15132','Police','Police affairs and services.\r','Admin','2016-12-26 23:51:25','D','15130\r'),('15133','Fire and rescue services','Fire-prevention and fire-fighting affairs and services.\r','Admin','2016-12-26 23:51:25','D','15130\r'),('15134','Judicial affairs','Civil and criminal law courts and the judicial system, including enforcement of fines and legal settlements imposed by the courts and operation of parole and probation systems.\r','Admin','2016-12-26 23:51:25','D','15130\r'),('15135','Ombudsman','Independent service representing the interests of the public by investigating and addressing complaints of unfair treatment or maladministration.\r','Admin','2016-12-26 23:51:25','D','15130\r'),('15136','Immigration','Immigration affairs and services, including alien registration, issuing work and travel documents to immigrants.\r','Admin','2016-12-26 23:51:25','D','15130\r'),('15137','Prisons','\r','Admin','2016-12-26 23:51:25','D','15130\r'),('15142','Macroeconomic policy','Macroeconomic policy development and implementation.\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15143','Meteorological services','Operation or support of institutions dealing with weather forecasting.\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15144','National standards development','Operation or support of institutions dealing with national standards development. (Use code 16062 for statistical capacity-building.)\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15150','Democratic participation and civil society','Support to the exercise of democracy and diverse forms of participation of citizens beyond elections (15151), direct democracy instruments such as referenda and citizens initiatives, support to organisations to represent and advocate for their members, to monitor, engage and hold governments to account, and to help citizens learn to act in the public sphere, curricula and teaching for civic education at various levels. (This purpose code is restricted to activities targeting governance issues. When assistance to civil society is for non-governance purposes use other appropriate purpose codes.)\r','Admin','2016-12-26 23:51:25','D','151\r'),('15151','Elections','Electoral management bodies and processes, election observation, voters\' education. (Use code 15230 when in the context of an international peacekeeping operation).\r','Admin','2016-12-26 23:51:25','D','15150\r'),('15152','Legislatures and political parties','Assistance to strengthen key functions of legislatures/ parliaments including subnational assemblies and councils (representation, oversight, legislation), such as improving the capacity of legislative bodies, improving legislatures committees and administrative procedures,, research and information management systems, providing training programmes for legislators and support personnel. Assistance to political parties and strengthening of party systems.\r','Admin','2016-12-26 23:51:25','D','15150\r'),('15153','Media and free flow of information','Activities that support free and uncensored flow of information on public issues, activities that increase the editorial and technical skills and the integrity of the print and broadcast media, e.g. training of journalists. (Use codes 22010-22040 for provision of equipment and capital assistance to media.)\r','Admin','2016-12-26 23:51:25','D','15150\r'),('15154','Executive office','Administration, operation or support of executive office. Includes office of the chief executive at all levels of government (monarch, governor-general, president, prime minister, governor, mayor, etc.).\r','Admin','2016-12-26 23:51:25','D','15110\r'),('15155','Tax policy and administration support','\r','Admin','2016-12-26 23:51:25','D','15114\r'),('15156','Other non-tax revenue mobilisation','Non-tax public revenue, which includes line ministries, revenue authorities or other local, regional or national public bodies. \r','Admin','2016-12-26 23:51:25','D','15114\r'),('15160','Human rights','Measures to support specialised official human rights institutions and mechanisms at universal, regional, national and local levels in their statutory roles to promote and protect civil and political, economic, social and cultural rights as defined in international conventions and covenants, translation of international human rights commitments into national legislation, reporting and follow-up, human rights dialogue.\r','Admin','2016-12-26 23:51:25','D','151\r'),('15170','Womens equality organisations and institutions','Support for institutions and organisations (governmental and non-governmental) working for gender equality and womens empowerment.\r','Admin','2016-12-26 23:51:25','D','151\r'),('15180','Ending violence against women and girls (taking effect as from 2017 reporting on 2016 flows)','Support to programmes designed to prevent and eliminate all forms of violence against women and girls/gender-based violence. This encompasses a broad range of forms of physical, sexual and psychological violence including but not limited to: intimate partner violence (domestic violence), sexual violence, female genital mutilation/cutting (FGM/C), child, early and forced marriage, acid throwing, honour killings, and trafficking of women and girls.\r','Admin','2016-12-26 23:51:25','D','151\r'),('15185','Local government administration','Decentralisation processes (including political, administrative and fiscal dimensions), intergovernmental relations and federalism, strengthening local authorities.\r','Admin','2016-12-26 23:51:25','D','15112\r'),('152','Conflict prevention and resolution, peace and security','N.B. Further notes on ODA eligibility (and exclusions) of conflict, peace and security related activities are given in paragraphs 76-81 of the Directives.\r','Admin','2016-12-26 23:51:25','D','150\r'),('15210','Security system management and reform','Technical co-operation provided to parliament, government ministries, law enforcement agencies and the judiciary to assist review and reform of the security system to improve democratic governance and civilian control, technical co-operation provided to government to improve civilian oversight and democratic control of budgeting, management, accountability and auditing of security expenditure, including military budgets, as part of a public expenditure management programme, assistance to civil society to enhance its competence and capacity to scrutinise the security system so that it is managed in accordance with democratic norms and principles of accountability, transparency and good governance. [Other than in the context of an international peacekeeping operation (15230).]\r','Admin','2016-12-26 23:51:25','D','152\r'),('15220','Civilian peace-building, conflict prevention and resolution','Support for civilian activities related to peace building, conflict prevention and resolution, including capacity building, monitoring, dialogue and information exchange. Bilateral participation in international civilian peace missions such as those conducted by the UN Department of Political Affairs (UNDPA) or the European Union (European Security and Defence Policy), and contributions to civilian peace funds or commissions (e.g. Peacebuilding Commission, Peacebuilding thematic window of the MDG achievement fund etc.). The contributions can take the form of financing or provision of equipment or civilian or military personnel (e.g. for training civilians). (Use code 15230 for bilateral participation in international peacekeeping operations).\r','Admin','2016-12-26 23:51:25','D','152\r'),('15230','Participation in international peacekeeping operations','Bilateral participation in peacekeeping operations mandated or authorised by the United Nations (UN) through Security Council resolutions, and conducted by international organisations, e.g. UN, NATO, the European Union (Security and Defence Policy security-related operations), or regional groupings of developing countries.\r','Admin','2016-12-26 23:51:25','D','152\r'),('15240','Reintegration and SALW control','Reintegration of demobilised military personnel into the economy, conversion of production facilities from military to civilian outputs, technical co-operation to control, prevent and/or reduce the proliferation of small arms and light weapons (SALW)  see para. 80 of the Directives for definition of SALW activities covered. [Other than in the context of an international peacekeeping operation (15230) or child soldiers (15261)].\r','Admin','2016-12-26 23:51:25','D','152\r'),('15250','Removal of land mines and explosive remnants of war','All activities related to land mines and explosive remnants of war which have benefits to developing countries as their main objective, including removal of land mines and explosive remnants of war, and stockpile destruction for developmental purposes [other than in the context of an international peacekeeping operation (15230)], risk education and awareness raising, rehabilitation, reintegration and assistance to victims, and research and development on demining and clearance. Only activities for civilian purposes are ODA-eligible.\r','Admin','2016-12-26 23:51:25','D','152\r'),('15261','Child soldiers (Prevention and demobilisation)','Technical co-operation provided to government  and assistance to civil society organisations  to support and apply legislation designed to prevent the recruitment of child soldiers, and to demobilise, disarm, reintegrate, repatriate and resettle (DDR) child soldiers.\r','Admin','2016-12-26 23:51:25','D','152\r'),('160','OTHER SOCIAL INFRASTRUCTURE AND SERVICES','\r','Admin','2016-12-26 23:51:25','D','\r'),('16010','Social/ welfare services','Social legislation and administration, institution capacity building and advice, social security and other social schemes, special programmes for the elderly, orphans, the disabled, street children, social dimensions of structural adjustment, unspecified social infrastructure and services, including consumer protection.\r','Admin','2016-12-26 23:51:25','D','160\r'),('16011','Social protection and welfare services policy, planning and administration','Administration of overall social protection policies, plans, programmes and budgets including legislation, standards and statistics on social protection.\r','Admin','2016-12-26 23:51:25','D','16010\r'),('16012','Social security (excl pensions)','Social protection shemes in the form of cash or in-kind benefits to people unable to work due to sickness or injury.\r','Admin','2016-12-26 23:51:25','D','16010\r'),('16013','General pensions','Social protection schemes in the form of cash or in-kind benefits, including pensions, against the risks linked to old age.\r','Admin','2016-12-26 23:51:25','D','16010\r'),('16014','Civil service pensions','Pension schemes for government personnel.\r','Admin','2016-12-26 23:51:25','D','16010\r'),('16015','Social services (incl youth development and women+ children)','Social protection schemes in the form of cash or in-kind benefits to households with dependent children, including parental leave benefits.\r','Admin','2016-12-26 23:51:25','D','16010\r'),('16020','Employment policy and administrative management','Employment policy and planning, labour law, labour unions, institution capacity building and advice, support programmes for unemployed, employment creation and income generation programmes, occupational safety and health, combating child labour.\r','Admin','2016-12-26 23:51:25','D','160\r'),('16030','Housing policy and administrative management','Housing sector policy, planning and programmes, excluding low-cost housing and slum clearance (16040).\r','Admin','2016-12-26 23:51:25','D','160\r'),('16040','Low-cost housing','Including slum clearance.\r','Admin','2016-12-26 23:51:25','D','160\r'),('16050','Multisector aid for basic social services','Basic social services are defined to include basic education, basic health, basic nutrition, population/reproductive health and basic drinking water supply and basic sanitation.\r','Admin','2016-12-26 23:51:25','D','160\r'),('16061','Culture and recreation','Including libraries and museums.\r','Admin','2016-12-26 23:51:25','D','160\r'),('16062','Statistical capacity building','Both in national statistical offices and any other government ministries.\r','Admin','2016-12-26 23:51:25','D','160\r'),('16063','Narcotics control','In-country and customs controls including training of the police, educational programmes and awareness campaigns to restrict narcotics traffic and in-country distribution 1.\r','Admin','2016-12-26 23:51:25','D','160\r'),('16064','Social mitigation of HIV/AIDS','Special programmes to address the consequences of HIV/AIDS, e.g. social, legal and economic assistance to people living with HIV/AIDS including food security and employment, support to vulnerable groups and children orphaned by HIV/AIDS, human rights of HIV/AIDS affected people.\r','Admin','2016-12-26 23:51:25','D','160\r'),('16065','Recreation and sport','\r','Admin','2016-12-26 23:51:25','D','16061\r'),('16066','Culture','\r','Admin','2016-12-26 23:51:25','D','16061\r'),('2','DSector1','DevSec1','sys','2016-12-25 00:00:00','Dev',NULL),('2000','Health','\r','Admin','2016-12-26 23:51:25','H','\r'),('210','TRANSPORT AND STORAGE','Note: Manufacturing of transport equipment should be included under code 32172.\r','Admin','2016-12-26 23:51:25','D','\r'),('21010','Transport policy and administrative management','Transport sector policy, planning and programmes, aid to transport ministries, institution capacity building and advice, unspecified transport, activities that combine road, rail, water and/or air transport. Whenever possible, report transport of goods under the sector of the good being transported.\r','Admin','2016-12-26 23:51:25','D','210\r'),('21011','Transport policy, planning and administration','Administration of affairs and services concerning transport systems.\r','Admin','2016-12-26 23:51:25','D','21010\r'),('21012','Public transport services','Administration of affairs and services concerning public transport.\r','Admin','2016-12-26 23:51:25','D','21010\r'),('21013','Transport regulation','Supervision and regulation of users, operations, construction and maintenance of transport systems (registration, licensing, inspection of equipment, operator skills and training, safety standards, franchises, tarriffs, levels of service, etc.).\r','Admin','2016-12-26 23:51:25','D','21010\r'),('21020','Road transport','Road infrastructure, road vehicles, passenger road transport, motor passenger cars.\r','Admin','2016-12-26 23:51:25','D','210\r'),('21021','Feeder road construction','Construction or operation of feeder road transport systems and facilities.\r','Admin','2016-12-26 23:51:25','D','21020\r'),('21022','Feeder road maintenance','Maintenance of feeder road transport systems and facilities.\r','Admin','2016-12-26 23:51:25','D','21020\r'),('21023','National road construction','Construction or operation of national road transport systems and facilities.\r','Admin','2016-12-26 23:51:25','D','21020\r'),('21024','National road maintenance','Maintenance of national road transport systems and facilities.\r','Admin','2016-12-26 23:51:25','D','21020\r'),('21030','Rail transport','Rail infrastructure, rail equipment, locomotives, other rolling stock, including light rail (tram) and underground systems.\r','Admin','2016-12-26 23:51:25','D','210\r'),('21040','Water transport','Harbours and docks, harbour guidance systems, ships and boats, river and other inland water transport, inland barges and vessels.\r','Admin','2016-12-26 23:51:25','D','210\r'),('21050','Air transport','Airports, airport guidance systems, aeroplanes, aeroplane maintenance equipment.\r','Admin','2016-12-26 23:51:25','D','210\r'),('21061','Storage','Whether or not related to transportation. Whenever possible, report storage projects under the sector of the resource being stored.\r','Admin','2016-12-26 23:51:25','D','210\r'),('21081','Education and training in transport and storage','\r','Admin','2016-12-26 23:51:25','D','210\r'),('220','COMMUNICATIONS','\r','Admin','2016-12-26 23:51:25','D','\r'),('22010','Communications policy and administrative management','Communications sector policy, planning and programmes, institution capacity building and advice, including postal services development, unspecified communications activities.\r','Admin','2016-12-26 23:51:25','D','220\r'),('22011','Communications policy, planning and administration','\r','Admin','2016-12-26 23:51:25','D','22010\r'),('22012','Postal services','Development and operation of postal services.\r','Admin','2016-12-26 23:51:25','D','22010\r'),('22013','Information services','Provision of information services.\r','Admin','2016-12-26 23:51:25','D','22010\r'),('22020','Telecommunications','Telephone networks, telecommunication satellites, earth stations.\r','Admin','2016-12-26 23:51:25','D','220\r'),('22030','Radio/television/print media','Radio and TV links, equipment, newspapers, printing and publishing.\r','Admin','2016-12-26 23:51:25','D','220\r'),('22040','Information and communication technology (ICT)','Computer hardware and software, internet access, IT training. When sector cannot be specified.\r','Admin','2016-12-26 23:51:25','D','220\r'),('230','ENERGY GENERATION, DISTRIBUTION AND EFFICIENCY','Categories 231 through 235 include both electric power plants and combined heat and power (CHP) plants. Heat-only plants, whatever the type of fuel, are reportable under category 236. Activities relating to fuelwood/charcoal production, energy manufacturing and natural resources extraction (including oil and gas pipelines) are reportable under categories 312, 321 et 322 respectively.\r','Admin','2016-12-26 23:51:25','D','\r'),('231','Energy generation, distribution and efficiency  general','\r','Admin','2016-12-26 23:51:25','D','230\r'),('23110','Energy policy and administrative management','Energy sector policy, planning, aid to energy ministries, institution capacity building and advice, unspecified energy activities.\r','Admin','2016-12-26 23:51:25','D','231\r'),('23111','Energy sector policy, planning and administration','\r','Admin','2016-12-26 23:51:25','D','23110\r'),('23112','Energy regulation','Regulation of the energy sector, including wholesale and retail electricity provision.\r','Admin','2016-12-26 23:51:25','D','23110\r'),('23181','Energy education/training','All levels of training not included elsewhere.\r','Admin','2016-12-26 23:51:25','D','231\r'),('23182','Energy research','Including general inventories, surveys.\r','Admin','2016-12-26 23:51:25','D','231\r'),('23183','Energy conservation and demand-side efficiency','All projects in support of energy demand reduction, e.g. building and industry upgrades, smart grids, metering and tariffs. Also includes efficient cook-stoves and biogas projects.\r','Admin','2016-12-26 23:51:25','D','231\r'),('232','Energy generation, renewable sources','\r','Admin','2016-12-26 23:51:25','D','230\r'),('23210','Energy generation, renewable sources  multiple technologies','Renewable energy generation programmes that cannot be attributed to one single technology (codes 23220 through 23280 below). Fuelwood/charcoal production should be included under forestry 31261.\r','Admin','2016-12-26 23:51:25','D','232\r'),('23220','Hydro-electric power plants','Including energy generating river barges.\r','Admin','2016-12-26 23:51:25','D','232\r'),('23230','Solar energy','Including photo-voltaic cells, solar thermal applications and solar heating.\r','Admin','2016-12-26 23:51:25','D','232\r'),('23240','Wind energy','Wind energy for water lifting and electric power generation.\r','Admin','2016-12-26 23:51:25','D','232\r'),('23250','Marine energy','Including ocean thermal energy conversion, tidal and wave power.\r','Admin','2016-12-26 23:51:25','D','232\r'),('23260','Geothermal energy','Use of geothermal energy for generating electric power or directly as heat for agriculture, etc.\r','Admin','2016-12-26 23:51:25','D','232\r'),('23270','Biofuel-fired power plants','Use of solids and liquids produced from biomass for direct power generation. Also includes biogases from anaerobic fermentation (e.g. landfill gas, sewage sludge gas, fermentation of energy crops and manure) and thermal processes (also known as syngas), waste-fired power plants making use of biodegradable municipal waste (household waste and waste from companies and public services that resembles household waste, collected at installations specifically designed for their disposal with recovery of combustible liquids, gases or heat). See code 23360 for non- renewable waste-fired power plants.\r','Admin','2016-12-26 23:51:25','D','232\r'),('233','Energy generation, non-renewable sources','\r','Admin','2016-12-26 23:51:25','D','\r'),('23310','Energy generation, non-renewable sources  unspecified','Thermal power plants including when energy source cannot be determined, combined gas-coal power plants.\r','Admin','2016-12-26 23:51:25','D','233\r'),('23320','Coal-fired electric power plants','Thermal electric power plants that use coal as the energy source.\r','Admin','2016-12-26 23:51:25','D','233\r'),('23330','Oil-fired electric power plants','Thermal electric power plants that use fuel oil or diesel fuel as the energy source.\r','Admin','2016-12-26 23:51:25','D','233\r'),('23340','Natural gas-fired electric power plants','Electric power plants that are fuelled by natural gas.\r','Admin','2016-12-26 23:51:25','D','233\r'),('23350','Fossil fuel electric power plants with carbon capture and storage (CCS)','Fossil fuel electric power plants employing technologies to capture carbon dioxide emissions. CCS not related to power plants should be included under 41020. CCS activities are not reportable as ODA.\r','Admin','2016-12-26 23:51:25','D','233\r'),('23360','Non-renewable waste-fired electric power plants','Electric power plants that use non-biodegradable industrial and municipal waste as the energy source.\r','Admin','2016-12-26 23:51:25','D','233\r'),('234','Hybrid energy electric power plants','\r','Admin','2016-12-26 23:51:25','D','\r'),('23410','Hybrid energy electric power plants','Electric power plants that make use of both non-renewable and renewable energy sources.\r','Admin','2016-12-26 23:51:25','D','234\r'),('235','Nuclear energy electric power plants','\r','Admin','2016-12-26 23:51:25','D','\r'),('23510','Nuclear energy electric power plants','Including nuclear safety.\r','Admin','2016-12-26 23:51:25','D','235\r'),('236','Heating, cooling and energy distribution','\r','Admin','2016-12-26 23:51:25','D','\r'),('23610','Heat plants','Power plants which are designed to produce heat only.\r','Admin','2016-12-26 23:51:25','D','236\r'),('23620','District heating and cooling','Distribution of heat generated in a centralised location, or delivery of chilled water, for residential and commercial heating or cooling purposes.\r','Admin','2016-12-26 23:51:25','D','236\r'),('23630','Electric power transmission and distribution','Grid distribution from power source to end user, transmission lines. Also includes storage of energy to generate power (e.g. pumped hydro, batteries) and the extension of grid access, often to rural areas.\r','Admin','2016-12-26 23:51:25','D','236\r'),('23640','Gas distribution','Delivery for use by ultimate consumer.\r','Admin','2016-12-26 23:51:25','D','236\r'),('240','BANKING AND FINANCIAL SERVICES','\r','Admin','2016-12-26 23:51:25','D','\r'),('24010','Financial policy and administrative management','Finance sector policy, planning and programmes, institution capacity building and advice, financial markets and systems.\r','Admin','2016-12-26 23:51:25','D','240\r'),('24020','Monetary institutions','Central banks.\r','Admin','2016-12-26 23:51:25','D','240\r'),('24030','Formal sector financial intermediaries','All formal sector financial intermediaries, credit lines, insurance, leasing, venture capital, etc. (except when focused on only one sector).\r','Admin','2016-12-26 23:51:25','D','240\r'),('24040','Informal/semi-formal financial intermediaries','Micro credit, savings and credit co-operatives etc.\r','Admin','2016-12-26 23:51:25','D','240\r'),('24081','Education/training in banking and financial services','\r','Admin','2016-12-26 23:51:25','D','240\r'),('250','BUSINESS AND OTHER SERVICES','\r','Admin','2016-12-26 23:51:25','D','\r'),('25010','Business support services and institutions','Support to trade and business associations, chambers of commerce, legal and regulatory reform aimed at improving business and investment climate, private sector institution capacity building and advice, trade information, public-private sector networking including trade fairs, e-commerce. Where sector cannot be specified: general support to private sector enterprises (in particular, use code 32130 for enterprises in the industrial sector).\r','Admin','2016-12-26 23:51:25','D','250\r'),('25020','Privatisation','When sector cannot be specified. Including general state enterprise restructuring or demonopolisation programmes, planning, programming, advice.\r','Admin','2016-12-26 23:51:25','D','250\r'),('3','OSector1','OtherSec1','sys','2016-12-25 00:00:00','Oth',NULL),('3000','Access to land','\r','Admin','2016-12-26 23:51:25','H','\r'),('311','AGRICULTURE','\r','Admin','2016-12-26 23:51:25','D','\r'),('31110','Agricultural policy and administrative management','Agricultural sector policy, planning and programmes, aid to agricultural ministries, institution capacity building and advice, unspecified agriculture.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31120','Agricultural development','Integrated projects, farm development.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31130','Agricultural land resources','Including soil degradation control, soil improvement, drainage of water logged areas, soil desalination, agricultural land surveys, land reclamation, erosion control, desertification control.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31140','Agricultural water resources','Irrigation, reservoirs, hydraulic structures, ground water exploitation for agricultural use.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31150','Agricultural inputs','Supply of seeds, fertilizers, agricultural machinery/equipment.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31161','Food crop production','Including grains (wheat, rice, barley, maize, rye, oats, millet, sorghum), horticulture, vegetables, fruit and berries, other annual and perennial crops. [Use code 32161 for agro-industries.]\r','Admin','2016-12-26 23:51:25','D','311\r'),('31162','Industrial crops/export crops','Including sugar, coffee, cocoa, tea, oil seeds, nuts, kernels, fibre crops, tobacco, rubber. [Use code 32161 for agro-industries.]\r','Admin','2016-12-26 23:51:25','D','311\r'),('31163','Livestock','Animal husbandry, animal feed aid.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31164','Agrarian reform','Including agricultural sector adjustment.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31165','Agricultural alternative development','Projects to reduce illicit drug cultivation through other agricultural marketing and production opportunities (see code 43050 for non-agricultural alternative development).\r','Admin','2016-12-26 23:51:25','D','311\r'),('31166','Agricultural extension','Non-formal training in agriculture.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31181','Agricultural education/training','\r','Admin','2016-12-26 23:51:25','D','311\r'),('31182','Agricultural research','Plant breeding, physiology, genetic resources, ecology, taxonomy, disease control, agricultural bio-technology, including livestock research (animal health, breeding and genetics, nutrition, physiology).\r','Admin','2016-12-26 23:51:25','D','311\r'),('31191','Agricultural services','Marketing policies & organisation, storage and transportation, creation of strategic reserves.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31192','Plant and post-harvest protection and pest control','Including integrated plant protection, biological plant protection activities, supply and management of agrochemicals, supply of pesticides, plant protection policy and legislation.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31193','Agricultural financial services','Financial intermediaries for the agricultural sector including credit schemes, crop insurance.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31194','Agricultural co-operatives','Including farmers organisations.\r','Admin','2016-12-26 23:51:25','D','311\r'),('31195','Livestock/veterinary services','Animal health and management, genetic resources, feed resources.\r','Admin','2016-12-26 23:51:25','D','311\r'),('312','FORESTRY','\r','Admin','2016-12-26 23:51:25','D','\r'),('31210','Forestry policy and administrative management','Forestry sector policy, planning and programmes, institution capacity building and advice, forest surveys, unspecified forestry and agro-forestry activities.\r','Admin','2016-12-26 23:51:25','D','312\r'),('31220','Forestry development','Afforestation for industrial and rural consumption, exploitation and utilisation, erosion control, desertification control, integrated forestry projects.\r','Admin','2016-12-26 23:51:25','D','312\r'),('31261','Fuelwood/charcoal','Forestry development whose primary purpose is production of fuelwood and charcoal.\r','Admin','2016-12-26 23:51:25','D','312\r'),('31281','Forestry education/training','\r','Admin','2016-12-26 23:51:25','D','312\r'),('31282','Forestry research','Including artificial regeneration, genetic improvement, production methods, fertilizer, harvesting.\r','Admin','2016-12-26 23:51:25','D','312\r'),('31291','Forestry services','\r','Admin','2016-12-26 23:51:25','D','312\r'),('313','FISHING','\r','Admin','2016-12-26 23:51:25','D','\r'),('31310','Fishing policy and administrative management','Fishing sector policy, planning and programmes, institution capacity building and advice, ocean and coastal fishing, marine and freshwater fish surveys and prospecting, fishing boats/equipment, unspecified fishing activities.\r','Admin','2016-12-26 23:51:25','D','313\r'),('31320','Fishery development','Exploitation and utilisation of fisheries, fish stock protection, aquaculture, integrated fishery projects.\r','Admin','2016-12-26 23:51:25','D','313\r'),('31381','Fishery education/training','\r','Admin','2016-12-26 23:51:25','D','313\r'),('31382','Fishery research','Pilot fish culture, marine/freshwater biological research.\r','Admin','2016-12-26 23:51:25','D','313\r'),('31391','Fishery services','Fishing harbours, fish markets, fishery transport and cold storage.\r','Admin','2016-12-26 23:51:25','D','313\r'),('321','INDUSTRY','\r','Admin','2016-12-26 23:51:25','D','\r'),('32110','Industrial policy and administrative management','Industrial sector policy, planning and programmes, institution capacity building and advice, unspecified industrial activities, manufacturing of goods not specified below.\r','Admin','2016-12-26 23:51:25','D','321\r'),('32120','Industrial development','\r','Admin','2016-12-26 23:51:25','D','321\r'),('32130','Small and medium-sized enterprises (SME) development','Direct support to the development of small and medium-sized enterprises in the industrial sector, including accounting, auditing and advisory services.\r','Admin','2016-12-26 23:51:25','D','321\r'),('32140','Cottage industries and handicraft','\r','Admin','2016-12-26 23:51:25','D','321\r'),('32161','Agro-industries','Staple food processing, dairy products, slaughter houses and equipment, meat and fish processing and preserving, oils/fats, sugar refineries, beverages/tobacco, animal feeds production.\r','Admin','2016-12-26 23:51:25','D','321\r'),('32162','Forest industries','Wood production, pulp/paper production.\r','Admin','2016-12-26 23:51:25','D','321\r'),('32163','Textiles, leather and substitutes','Including knitting factories.\r','Admin','2016-12-26 23:51:25','D','321\r'),('32164','Chemicals','Industrial and non-industrial production facilities, includes pesticides production.\r','Admin','2016-12-26 23:51:25','D','321\r'),('32165','Fertilizer plants','\r','Admin','2016-12-26 23:51:25','D','321\r'),('32166','Cement/lime/plaster','\r','Admin','2016-12-26 23:51:25','D','321\r'),('32167','Energy manufacturing','Including gas liquefaction, petroleum refineries.\r','Admin','2016-12-26 23:51:25','D','321\r'),('32168','Pharmaceutical production','Medical equipment/supplies, drugs, medicines, vaccines, hygienic products.\r','Admin','2016-12-26 23:51:25','D','321\r'),('32169','Basic metal industries','Iron and steel, structural metal production.\r','Admin','2016-12-26 23:51:25','D','321\r'),('32170','Non-ferrous metal industries','\r','Admin','2016-12-26 23:51:25','D','321\r'),('32171','Engineering','Manufacturing of electrical and non-electrical machinery, engines/turbines.\r','Admin','2016-12-26 23:51:25','D','321\r'),('32172','Transport equipment industry','Shipbuilding, fishing boats building, railroad equipment, motor vehicles and motor passenger cars, aircraft, navigation/guidance systems.\r','Admin','2016-12-26 23:51:25','D','321\r'),('32182','Technological research and development','Including industrial standards, quality management, metrology, testing, accreditation, certification.\r','Admin','2016-12-26 23:51:25','D','321\r'),('322','MINERAL RESOURCES AND MINING','\r','Admin','2016-12-26 23:51:25','D','\r'),('32210','Mineral/mining policy and administrative management','Mineral and mining sector policy, planning and programmes, mining legislation, mining cadastre, mineral resources inventory, information systems, institution capacity building and advice, unspecified mineral resources exploitation.\r','Admin','2016-12-26 23:51:25','D','322\r'),('32220','Mineral prospection and exploration','Geology, geophysics, geochemistry, excluding hydrogeology (14010) and environmental geology (41010), mineral extraction and processing, infrastructure, technology, economics, safety and environment management.\r','Admin','2016-12-26 23:51:25','D','322\r'),('32261','Coal','Including lignite and peat.\r','Admin','2016-12-26 23:51:25','D','322\r'),('32262','Oil and gas','Petroleum, natural gas, condensates, liquefied petroleum gas (LPG), liquefied natural gas (LNG), including drilling and production, and oil and gas pipelines.\r','Admin','2016-12-26 23:51:25','D','322\r'),('32263','Ferrous metals','Iron and ferro-alloy metals.\r','Admin','2016-12-26 23:51:25','D','322\r'),('32264','Nonferrous metals','Aluminium, copper, lead, nickel, tin, zinc.\r','Admin','2016-12-26 23:51:25','D','322\r'),('32265','Precious metals/materials','Gold, silver, platinum, diamonds, gemstones.\r','Admin','2016-12-26 23:51:25','D','322\r'),('32266','Industrial minerals','Baryte, limestone, feldspar, kaolin, sand, gypsym, gravel, ornamental stones.\r','Admin','2016-12-26 23:51:25','D','322\r'),('32267','Fertilizer minerals','Phosphates, potash.\r','Admin','2016-12-26 23:51:25','D','322\r'),('32268','Offshore minerals','Polymetallic nodules, phosphorites, marine placer deposits.\r','Admin','2016-12-26 23:51:25','D','322\r'),('323','CONSTRUCTION','\r','Admin','2016-12-26 23:51:25','D','\r'),('32310','Construction policy and administrative management','Construction sector policy and planning, excluding construction activities within specific sectors (e.g., hospital or school construction).\r','Admin','2016-12-26 23:51:25','D','323\r'),('331','TRADE POLICY AND REGULATIONS AND TRADE- RELATED ADJUSTMENT','\r','Admin','2016-12-26 23:51:25','D','\r'),('33110','Trade policy and administrative Management','Trade policy and planning, support to ministries and departments responsible for trade policy, trade-related legislation and regulatory reforms, policy analysis and implementation of multilateral trade agreements e.g. technical barriers to trade and sanitary and phytosanitary measures (TBT/SPS) except at regional level (see 33130), mainstreaming trade in national development strategies (e.g. poverty reduction strategy papers), wholesale/retail trade, unspecified trade and trade promotion activities.\r','Admin','2016-12-26 23:51:25','D','331\r'),('33120','Trade facilitation','Simplification and harmonisation of international import and export procedures (e.g. customs valuation, licensing procedures, transport formalities, payments, insurance), support to customs departments, tariff reforms.\r','Admin','2016-12-26 23:51:25','D','331\r'),('33130','Regional trade agreements (RTAs)','Support to regional trade arrangements [e.g. Southern African Development Community (SADC), Association of Southeast Asian Nations (ASEAN), Free Trade Area of the Americas (FTAA), African Caribbean Pacific/European Union (ACP/EU)], including work on technical barriers to trade and sanitary and phytosanitary measures (TBT/SPS) at regional level, elaboration of rules of origin and introduction of special and differential treatment in RTAs.\r','Admin','2016-12-26 23:51:25','D','331\r'),('33140','Multilateral trade negotiations','Support developing countries effective participation in multilateral trade negotiations, including training of negotiators, assessing impacts of negotiations, accession to the World Trade Organisation (WTO) and other multilateral trade-related organisations.\r','Admin','2016-12-26 23:51:25','D','331\r'),('33150','Trade-related adjustment','Contributions to the government budget to assist the implementation of recipients own trade reforms and adjustments to trade policy measures by other countries, assistance to manage shortfalls in the balance of payments due to changes in the world trading environment.\r','Admin','2016-12-26 23:51:25','D','331\r'),('33181','Trade education/training','Human resources development in trade not included under any of the above codes. Includes university programmes in trade.\r','Admin','2016-12-26 23:51:25','D','331\r'),('332','TOURISM','\r','Admin','2016-12-26 23:51:25','D','\r'),('33210','Tourism policy and administrative management','\r','Admin','2016-12-26 23:51:25','D','332\r'),('4000','WASH','\r','Admin','2016-12-26 23:51:25','H','\r'),('410','General environmental protection','Covers activities concerned with conservation, protection or amelioration of the physical environment without sector allocation.\r','Admin','2016-12-26 23:51:25','D','\r'),('41010','Environmental policy and administrative management','Environmental policy, laws, regulations and economic instruments, administrational institutions and practices, environmental and land use planning and decision-making procedures, seminars, meetings, miscellaneous conservation and protection measures not specified below.\r','Admin','2016-12-26 23:51:25','D','410\r'),('41020','Biosphere protection','Air pollution control, ozone layer preservation, marine pollution control.\r','Admin','2016-12-26 23:51:25','D','410\r'),('41030','Bio-diversity','Including natural reserves and actions in the surrounding areas, other measures to protect endangered or vulnerable species and their habitats (e.g. wetlands preservation).\r','Admin','2016-12-26 23:51:25','D','410\r'),('41040','Site preservation','Applies to unique cultural landscape, including sites/objects of historical, archeological, aesthetic, scientific or educational value.\r','Admin','2016-12-26 23:51:25','D','410\r'),('41050','Flood prevention/control','Floods from rivers or the sea, including sea water intrusion control and sea level rise related activities.\r','Admin','2016-12-26 23:51:25','D','410\r'),('41081','Environmental education/ training','\r','Admin','2016-12-26 23:51:25','D','410\r'),('41082','Environmental research','Including establishment of databases, inventories/accounts of physical and natural resources, environmental profiles and impact studies if not sector specific.\r','Admin','2016-12-26 23:51:25','D','410\r'),('430','Other multisector','\r','Admin','2016-12-26 23:51:25','D','\r'),('43010','Multisector aid','\r','Admin','2016-12-26 23:51:25','D','\r'),('43030','Urban development and management','Integrated urban development projects, local development and urban management, urban infrastructure and services, municipal finances, urban environmental management, urban development and planning, urban renewal and urban housing, land information systems.\r','Admin','2016-12-26 23:51:25','D','430\r'),('43031','Urban land policy and management','Urban development and planning, urban management, land information systems.\r','Admin','2016-12-26 23:51:25','D','43030\r'),('43032','Urban development','Integrated urban development projects, local development, urban infrastructure and services, municipal finances, urban environment systems, urban renewal and urban housing.\r','Admin','2016-12-26 23:51:25','D','43030\r'),('43040','Rural development','Integrated rural development projects, e.g. regional development planning, promotion of decentralised and multi-sectoral competence for planning, co-ordination and management, implementation of regional development and measures (including natural reserve management), land management, land use planning, land settlement and resettlement activities [excluding resettlement of refugees and internally displaced persons (72010)], functional integration of rural and urban areas, geographical information systems.\r','Admin','2016-12-26 23:51:25','D','430\r'),('43041','Rural land policy and management','Regional development planning, promotion of decentralised and multi-sectoral competence for planning, co-ordination and management, land management, land use planning, geographical information systems.\r','Admin','2016-12-26 23:51:25','D','43040\r'),('43042','Rural development','Integrated rural development projects, implementation of regional development and measures (including natural reserve management), land settlement and resettlement activities [excluding resettlement of refugees and internally displaced persons (72010)], functional integration of rural and urban areas.\r','Admin','2016-12-26 23:51:25','D','43040\r'),('43050','Non-agricultural alternative development','Projects to reduce illicit drug cultivation through, for example, non-agricultural income opportunities, social and physical infrastructure (see code 31165 for agricultural alternative development).\r','Admin','2016-12-26 23:51:25','D','430\r'),('43081','Multisector education/training','Including scholarships.\r','Admin','2016-12-26 23:51:25','D','430\r'),('43082','Research/scientific institutions','When sector cannot be identified.\r','Admin','2016-12-26 23:51:25','D','430\r'),('5000','Protection','\r','Admin','2016-12-26 23:51:25','H','\r'),('510','General budget support','Budget support in the form of sector-wide approaches (SWAps) should be included in the respective sectors.\r','Admin','2016-12-26 23:51:25','D','\r'),('51010','General budget support-related aid','Unearmarked contributions to the government budget, support for the implementation of macroeconomic reforms (structural adjustment programmes, poverty reduction strategies), general programme assistance (when not allocable by sector).\r','Admin','2016-12-26 23:51:25','D','510\r'),('520','Developmental food aid/Food security assistance','\r','Admin','2016-12-26 23:51:25','D','\r'),('52010','Food aid/Food security programmes','Supply of edible human food under national or international programmes including transport costs, cash payments made for food supplies, project food aid and food aid for market sales when benefiting sector not specified, excluding emergency food aid.\r','Admin','2016-12-26 23:51:25','D','520\r'),('530','Other commodity assistance','Non-food commodity assistance (when benefiting sector not specified).\r','Admin','2016-12-26 23:51:25','D','\r'),('53030','Import support (capital goods)','Capital goods and services, lines of credit.\r','Admin','2016-12-26 23:51:25','D','530\r'),('53040','Import support (commodities)','Commodities, general goods and services, oil imports.\r','Admin','2016-12-26 23:51:25','D','530\r'),('600','Debt relief','\r','Admin','2016-12-26 23:51:25','D','\r'),('6000','Settler Violance','\r','Admin','2016-12-26 23:51:25','H','\r'),('60010','Action relating to debt','Actions falling outside the code headings below.\r','Admin','2016-12-26 23:51:25','D','600\r'),('60020','Debt forgiveness','\r','Admin','2016-12-26 23:51:25','D','600\r'),('60030','Relief of multilateral debt','Grants or credits to cover debt owed to multilateral financial institutions, including contributions to Heavily Indebted Poor Countries (HIPC) Trust Fund.\r','Admin','2016-12-26 23:51:25','D','600\r'),('60040','Rescheduling and refinancing','\r','Admin','2016-12-26 23:51:25','D','600\r'),('60061','Debt for development swap','Allocation of debt claims to use for development (e.g., debt for education, debt for environment).\r','Admin','2016-12-26 23:51:25','D','600\r'),('60062','Other debt swap','Where the debt swap benefits an external agent i.e. is not specifically for development purposes.\r','Admin','2016-12-26 23:51:25','D','600\r'),('60063','Debt buy-back','Purchase of debt for the purpose of cancellation.\r','Admin','2016-12-26 23:51:25','D','600\r'),('7000','Shelter','\r','Admin','2016-12-26 23:51:25','H','\r'),('720','Emergency Response','An emergency is a situation which results from man made crises and/or natural disasters.\r','Admin','2016-12-26 23:51:25','D','\r'),('72010','Material relief assistance and services','Shelter, water, sanitation and health services, supply of medicines and other non-food relief items for the benefit of affected people and to facilitate the return to normal lives and livelihoods, assistance to refugees and internally displaced people in developing countries other than for food (72040) or protection (72050).\r','Admin','2016-12-26 23:51:25','D','720\r'),('72040','Emergency food aid','Food aid normally for general free distribution or special supplementary feeding programmes, short-term relief to targeted population groups affected by emergency situations. Excludes non-emergency food security assistance programmes/food aid (52010).\r','Admin','2016-12-26 23:51:25','D','720\r'),('72050','Relief co-ordination, protection and support services','Measures to co-ordinate delivery of humanitarian aid, including logistics and communications systems, measures to promote and protect the safety, well- being, dignity and integrity of civilians and those no longer taking part in hostilities. (Activities designed to protect the security of persons or property through the use or display of force are not reportable as ODA.)\r','Admin','2016-12-26 23:51:25','D','720\r'),('730','Reconstruction relief and rehabilitation','This relates to activities during and in the aftermath of an emergency situation. Longer-term activities to improve the level of infrastructure or social services should be reported under the relevant economic and social sector codes. See also guideline on distinguishing humanitarian from sector- allocable aid.\r','Admin','2016-12-26 23:51:25','D','\r'),('73010','Reconstruction relief and rehabilitation','Short-term reconstruction work after emergency or conflict limited to restoring pre-existing infrastructure (e.g. repair or construction of roads, bridges and ports, restoration of essential facilities, such as water and sanitation, shelter, health care services), social and economic rehabilitation in the aftermath of emergencies to facilitate transition and enable populations to return to their previous livelihood or develop a new livelihood in the wake of an emergency situation (e.g. trauma counselling and treatment, employment programmes).\r','Admin','2016-12-26 23:51:25','D','730\r'),('740','Disaster prevention and preparedness','See codes 41050 and 15220 for prevention of floods and conflicts.\r','Admin','2016-12-26 23:51:25','D','\r'),('74010','Disaster prevention and preparedness','Disaster risk reduction activities (e.g. developing knowledge, natural risks cartography, legal norms for construction), early warning systems, emergency contingency stocks and contingency planning including preparations for forced displacement.\r','Admin','2016-12-26 23:51:25','D','740\r'),('8000','Agriculture','\r','Admin','2016-12-26 23:51:25','H','\r'),('910','ADMINISTRATIVE COSTS OF DONORS','\r','Admin','2016-12-26 23:51:25','D','\r'),('91010','Administrative costs (non-sector allocable)','\r','Admin','2016-12-26 23:51:25','D','910\r'),('930','REFUGEES IN DONOR COUNTRIES','\r','Admin','2016-12-26 23:51:25','D','\r'),('93010','Refugees in donor countries (non-sector allocable)','\r','Admin','2016-12-26 23:51:25','D','930\r'),('998','UNALLOCATED/  UNSPECIFIED','\r','Admin','2016-12-26 23:51:25','D','\r'),('99810','Sectors not specified','Contributions to general development of the recipient should be included under programme assistance (51010).\r','Admin','2016-12-26 23:51:25','D','998\r'),('99820','Promotion of development awareness (non-sector allocable)','Spending in donor country for heightened awareness/interest in development co-operation (brochures, lectures, special research projects, etc.).\r','Admin','2016-12-26 23:51:25','D','998\r');
